import axios from 'axios'
import { BASE_URL } from './Constants/url'

const DelMatch = () => {
  axios
    .put(`${BASE_URL}clear`)
    .then((res) => {
      alert(
        "Deslikes efetuados com sucesso, pode continuar a clicar a vontade!!"
      );
    })
    .cath((err) => {
      console.log(err.response.data);
    });
};
export default DelMatch
